import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import HandoverItem from './HandoverItem';


const HandoverList = ({ handovers, currentUser }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filters, setFilters] = useState({
    priority: 'all',
    status: 'all'
  });

  const filteredHandovers = handovers.filter(handover => {
    // Search term filter
    const matchesSearch = 
      handover.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
      handover.description.toLowerCase().includes(searchTerm.toLowerCase());
    
    // Priority filter
    const matchesPriority = 
      filters.priority === 'all' || handover.priority === filters.priority;
    
    // Status filter
    const matchesStatus = 
      filters.status === 'all' || handover.status === filters.status;
    
    return matchesSearch && matchesPriority && matchesStatus;
  });

  return (
    <div className="handover-list-container">
      <div className="handover-list-header">
        <h2>Shift Handovers</h2>
        <Link to="/create" className="create-btn">
          Create New Handover
        </Link>
      </div>
      
      <div className="filters">
        <div className="search-filter">
          <input
            type="text"
            placeholder="Search handovers..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <i className="search-icon"></i>
        </div>
        
        <div className="filter-group">
          <label>Priority:</label>
          <select
            value={filters.priority}
            onChange={(e) => setFilters({...filters, priority: e.target.value})}
          >
            <option value="all">All</option>
            <option value="low">Low</option>
            <option value="medium">Medium</option>
            <option value="high">High</option>
            <option value="critical">Critical</option>
          </select>
        </div>
        
        <div className="filter-group">
          <label>Status:</label>
          <select
            value={filters.status}
            onChange={(e) => setFilters({...filters, status: e.target.value})}
          >
            <option value="all">All</option>
            <option value="pending">Pending</option>
            <option value="in-progress">In Progress</option>
            <option value="completed">Completed</option>
          </select>
        </div>
      </div>
      
      {filteredHandovers.length === 0 ? (
        <div className="no-results">
          <div className="no-results-icon"></div>
          <h3>No handovers found</h3>
          {searchTerm && <p>Try a different search term or adjust your filters</p>}
          <Link to="/create" className="create-btn">
            Create Your First Handover
          </Link>
        </div>
      ) : (
        <div className="handover-items">
          {filteredHandovers.map(handover => (
            <HandoverItem 
              key={handover.id} 
              handover={handover} 
              currentUser={currentUser} 
            />
          ))}
        </div>
      )}
    </div>
  );
};

export default HandoverList;
